create table t_geohash
(
    geohash   varchar(255)   null comment 'geohash算法，根据经纬度算出geohash值',
    province  varchar(255)   not null comment '省级行政单位',
    city      varchar(55)    not null comment '市级行政单位',
    county    varchar(55)    not null comment '区(县)',
    longitude decimal(12, 9) not null comment '经度',
    latitude  decimal(12, 9) not null comment '纬度'
);

